import React from "react";
import { Avatar, Card } from "antd";

const UserProfile = () => {
  return (
    <Card>
      <Card.Meta avatar={<Avatar>YC</Avatar>} title="YoungCheon" />
    </Card>
  );
};

export default UserProfile;
